              Virtual assistants for entrepreneurs, professionals, <br /> small
              business, and teams.
            </p>
            {/* /.static-banner-two__text */}
            <a href="#" className="thm-btn static-banner-two__btn">
              Get Started now
            </a>
          </div>
          {/* /.col-lg-12 */}
        </div>
        {/* /.row */}
      </div>
      {/* /.container */}
    </section>
    {/* /.static-banner-two */}
  </React.Fragment>
);

export default Banner;
